import React from "react";

const Navbar = () => {
  return (
    <React.Fragment>
      <nav>
        <ul className="nav-left">
          <li>Home</li>
          <li>Host your own</li>
          <li>My Hostings</li>
          <li>About Us</li>
        </ul>
        <ul>
          <li className="nav-right">
            <button>Sign Up</button>
            <button>Log In</button>
          </li>
        </ul>
      </nav>
    </React.Fragment>
  );
};

export default Navbar;
